  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Bamforth NWR, Hutton Lake NWR, and Mortenson
  Lake NWR for the next 15 years. This plan outlines the refuges' vision and purpose
  and describes how the refuges will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the refuges, an overview of the CCP
  process, a summary of refuge resources, and information about the management direction.
  Key planning issues include: water resources, invasive species, science, land protection,
  partnerships, staffing, public use, and endangered species.\",\n\t\"license_title\":
